import React from "react";
import ballImage from "../ball.png";
import Draggable from "react-draggable";
import "../css/ball.css";

export const Ball = () => {
  return (
    <Draggable>
      <img
        style={{
          width: 25,
          height: 25,
          backgroundImage: new URL(ballImage),
          position: "absolute",
          zIndex: 3,
        }}
      />
    </Draggable>
  );
};
